import React from 'react';
import { Switch, Route } from 'react-router-dom';

import Home from './Home';
import Manager from './Admin/Manager';
import Petianos from './Petianos/Petianos';

import Login from './Login/Login';

import PostItem from './Blog/postItem';
import Cadastro from './Usuario/Perfil/Cadastro';
import EsqueceuSenha from './Login/EsqueceuSenha';
import RedefineSenha from './Login/RedefineSenha';
import TrocaSenha from './Usuario/Perfil/TrocaSenha';
import Evento from './Eventos/showEvento';
import EventoItem from './Eventos/eventoItem';
import AtividadeItem from './Eventos/atividadeItem';
import DadosAdicionais from './Eventos//DadosAdiconais/dadosAdicionais';
import UserProfile from './Usuario/userProfile';
import TrocarEmail from './Usuario/Perfil/trocarEmail';
import SolicitacaoAjudante from './Ajudante/solicitacaoAjudante';
import UserEvento from './Usuario/Eventos/showEventos';
import AtividadesEvento from './Usuario/Eventos/atividadesEvento';

const Main = () => (
  <main>
    <Switch>
      <Route exact path="/" component={Home} />
      <Route exact path="/pet" component={Home} />
      <Route exact path="/pet/petianos" component={Petianos} />
      <Route exact path="/pet/eventos" component={Evento} />/
      <Route
        path={`/pet/eventos/:id/atividades/:fk`}
        render={({ match }) => (
          <AtividadeItem
            eventoId={match.params.id}
            atividadeId={match.params.fk}
          />
        )}
      />
      <Route
        path="/pet/eventos/:id/cadastro"
        render={({ match }) => <DadosAdicionais idEvento={match.params.id} />}
      />
      <Route
        path="/pet/eventos/:id"
        render={({ match }) => <EventoItem id={match.params.id} />}
      />
      <Route exact path="/pet/login" component={Login} />
      <Route exact path="/pet/admin" component={Manager} />
      <Route exact path="/pet/blog" component={Blog} />
      <Route
        path="/pet/posts/:id"
        render={({ match }) => <PostItem id={match.params.id} />}
      />
      <Route exact path="/pet/cadastro" component={Cadastro} />
      <Route exact path="/pet/esqueceuSenha" component={EsqueceuSenha} />
      <Route
        path="/pet/reset-password/:access_token"
        component={RedefineSenha}
      />
      <Route exact path="/pet/perfil/trocarSenha" component={TrocaSenha} />
      <Route exact path="/pet/perfil/trocarEmail" component={TrocarEmail} />
      <Route exact path="/pet/perfil" component={UserProfile} />
      <Route exact path="/pet/meusEventos" component={UserEvento} />
      <Route
        exact
        path="/pet/meusEventos/:id/Atividades"
        render={({ match }) => <AtividadesEvento idEvento={match.params.id} />}
      />
      <Route
        path="/pet/solicitacaoAjudante/:id"
        render={({ match }) => (
          <SolicitacaoAjudante id={match.params.id} params={match} />
        )}
      />
    </Switch>
  </main>
);

export default Main;
